import React, { Component } from "react";
 
class Home extends Component {
  render() {
    return (
      <div>
        <h2>Hi!</h2>
        <p>I am glad you've landed here! My name is Japheth but you can call me "Jafi". 
            I am a <span>development planner</span>, <span>a writer</span> and <span> software developer</span> based in Kigali, Rwanda.
        </p>
 
        <p>Feel free to go around my page to explore how I combine planning and coding skills 
            to create innovative solutions to various development challenges we face in Africa.</p>
        
            <ul className="social">
          <li><a href="#"><i className="fa fa-facebook" /></a></li>
          <li><a href="#"><i className="fa fa-twitter" /></a></li>
          <li><a href="#"><i className="fa fa-linkedin" /></a></li>
          <li><a href="#"><i className="fa fa-skype" /></a></li>
          <li><a href="#"><i className="fa fa-github" /></a></li>
           </ul>
      </div>
    );
  }
}
 
export default Home;
